import React from 'react';
import './balise.scss';

const BaliseLayout = () => {

return(
		<div className='baliseLayout'>
				<div className='topHtml'>
						{'<html>'}
				</div>
				<div className='topBody'>
						{'<body>'}
				</div>
				<div className='bottomBody'>
						{'</body>'}
				</div>
				<div className='bottoHtml'>
						{'</html>'}
				</div>
		</div>
)};

export default BaliseLayout;
